import React from 'react';
import { Route, Link, Redirect } from 'react-router-dom';
import Listeencheres from './components/Listeencheres';

const App = () => {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
        </ul>
      </nav>

      <Route exact path="/" component={Listeencheres} />
      <Redirect to="/" />
    </div>
  );
};

export default App;
